def is_connected(adjacency_matrix):
    n = len(adjacency_matrix)
    visited = [False] * n

    # Perform a DFS from vertex 0
    dfs(0, visited, adjacency_matrix)

    # Check if all vertices were visited
    return all(visited)

def dfs(v, visited, adjacency_matrix):
    visited[v] = True
    for i in range(len(adjacency_matrix)):
        if adjacency_matrix[v][i] == 1 and not visited[i]:
            dfs(i, visited, adjacency_matrix)

